import React from "react";
import Header2 from "./Header2";
import Sider from "./Sider";

function Home() {
  return (
    <>
      <div
        style={{
          marginTop: "50px",
          backgroundColor: "green",
          width: "10%",
          height: "100vh",
          display: "flex",
          flexDirection: "row",
          display: "flex",
        }}
      >
        <Sider />
      <div style={{ backgroundColor: "gray", width: "50%" }}></div>
      </div>

    </>
  );
}
export default Home;
